    <h1>Kalkulator Obwodów – Wro Electric</h1>
</div>

<form id="circuitForm">
    <input type="text" id="nr" placeholder="Nr obwodu" required>
    <input type="text" id="desc" placeholder="Opis obwodu" required>
    <select id="voltage">
        <option value="230V">230V</option>
        <option value="400V">400V</option>
    </select>
    <input type="text" id="cable" placeholder="Typ kabla">
    <input type="number" id="power" placeholder="Moc (kW)" step="0.1" required>
    <input type="text" id="zone" placeholder="Strefa">
    <button type="submit">Dodaj / Zapisz</button>
</form>

<div id="notification"></div>

<table id="circuitTable">
    <thead>
        <tr>
            <th>Nr</th>
            <th>Opis</th>
            <th>Napięcie</th>
            <th>Kabel</th>
            <th>Moc (kW)</th>
            <th>Faza</th>
            <th>Strefa</th>
        </tr>
    </thead>
    <tbody></tbody>
</table>

<script>
    let circuits = [];
    let phaseTotals = { L1: 0, L2: 0, L3: 0 };

    function autoAssignPhase(power) {
        const min = Object.entries(phaseTotals).sort((a, b) => a[1] - b[1])[0][0];
        phaseTotals[min] += power;
        return min;
    }

    function notify(msg) {
        const note = document.getElementById("notification");
        note.innerHTML = '<div class="notification">' + msg + '</div>';
        setTimeout(() => note.innerHTML = '', 3000);
    }

    document.getElementById("circuitForm").addEventListener("submit", function(e) {
        e.preventDefault();
        const nr = document.getElementById("nr").value.trim();
        const desc = document.getElementById("desc").value.trim();
        const voltage = document.getElementById("voltage").value;
        const cable = document.getElementById("cable").value.trim();
        const power = parseFloat(document.getElementById("power").value);
        const zone = document.getElementById("zone").value.trim();

        if (!nr || !desc || isNaN(power)) {
            alert("Uzupełnij wszystkie wymagane pola.");
            return;
        }

        const phase = autoAssignPhase(power);
        circuits.push({ nr, desc, voltage, cable, power, phase, zone });
        renderTable();
        notify("Obwód został dodany.");
        document.getElementById("circuitForm").reset();
    });

    function renderTable() {
        const tbody = document.querySelector("#circuitTable tbody");
        tbody.innerHTML = "";
        circuits.forEach(c => {
            const row = `<tr>
                <td>${c.nr}</td>
                <td>${c.desc}</td>
                <td>${c.voltage}</td>
                <td>${c.cable}</td>
                <td>${c.power.toFixed(1)}</td>
                <td>${c.phase}</td>
                <td>${c.zone}</td>
            </tr>`;
            tbody.innerHTML += row;
        });
    }
</script>

</body>
</html>
